        static IEnumerable<TestCase<double>> GetD1Data(EllintD1Data[] data)
        {
            return data.Select(d => TestCase.Create(d.K, d.Result));
        }

        static IEnumerable<TestCase<double, double>> GetD2Data(EllintD2Data[] data)
        {
            return data.Select(d => TestCase.Create(d.K, d.Phi, d.Result));
        }

        [TestMethod]
        public void EllipticalDTest()
        {

            TestCaseSet<double>[] testCases = {
                new TestCaseSet<double>(GetD1Data(_D1SpotData), "EllintD: Spot Data", 5),                
                new TestCaseSet<double>(GetD1Data(_D1Data), "EllintD: Random Data", 5)
            };

            NumericFunctionTest.RunSet(Math2.EllintD, "EllintD", testCases);

        }


        [TestMethod]
        public void EllipticalD2Test()
        {

            TestCaseSet<double, double>[] testCases = {
                new TestCaseSet<double,double>(GetD2Data(_D2SpotData), "Spot Data", 6),                
                new TestCaseSet<double,double>(GetD2Data(_D2SpotNear1), "Spot Near 1", 100),
                new TestCaseSet<double,double>(GetD2Data(_D2Data), "Random Data", 6)
            };

            NumericFunctionTest.RunSet(Math2.EllintD, "EllintD", testCases);

        }



